angular.module("activityService",[]).factory("Activity",["$http",function($http){var activity={};return activity.all=function(){return $http.get("api/activities")},activity.get=function(id){return $http.get("api/activities/"+id)},activity.create=function(data){return $http.post("api/activities/",data)},activity.update=function(id,data){return $http.put("api/activities/"+id,data)},activity["delete"]=function(id){return $http["delete"]("api/activities/"+id)},activity}]);